edition = "2023";

package youtube.api.innertube;

import "youtube/api/innertube/feature_control.proto";
import "youtube/api/innertube/template_config_proto.proto";
import "youtube/api/innertube/gpc_lookup_key_effect_ids.proto";

option java_package = "com.google.protos.youtube.api.innertube";
option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "YTI";

message WebConfig {
	FeatureControl feature_control = 2;
	TemplateConfigProto template_config_proto = 3;
	GpcLookupKeyEffectIds gpc_lookup_key_effect_ids = 4;
}
